//erase functions
$('#eraser').click(function (evt) {
	evt.preventDefault();
	$('#pixelCanvas').on('click', 'td', function() {
//    console.log("click in color is working");
    //set background color to nothing in order to erase
	$(this).css('background-color', '');
	});

//calling an event on mouseover of the table based on the cell with a callback
	$('#pixelCanvas').on('mouseover', 'td', function() {
//    console.log("click in color is working");
    //get color selected by user

		//set background color to nothing to erase
		if (isDown === true) {
			$(this).css('background-color', '');
		}
	});
});

var z = 0;
//undo functionality
$('#undo').click(function (evt) {
	evt.preventDefault();
	var undoR = currentStateRow.length - y;
	var undoD = currentStateData.length - y;
	var rowH = $("#inputHeight").val();
	var colW = $('#inputWidth').val();
	
	console.log('this is new undoR: ' + undoR);
	console.log('this is new undoD: ' + undoD);
	
	console.log('this is undo: ' + undoD);
	if (undoR >= 0) {
		$('td').remove();
		$('tr').remove();
		
		$('#pixelCanvas').append(currentStateRow[undoR]);
		console.log('this is height in undo: ' + rowH);
		
		while (z <=  colW) {
			console.log('in while loop');
			$('tr:eq(' + z + ')').append(currentStateData[undoD]);
			z++;
		}
		
//		$('td:nth-child(even)').remove();
		y++;
		
		console.log('this is new StateR: ' + currentStateRow[undoR]);
//		console.log('this is new StateD: ' + currentStateData[undoD]);
	}	
});

//store undo and redo history
$('#pixelCanvas').on('mousedown', function() {
	currentStateRow[x] = $('tr');
	currentStateData[x] = $('td');
	x++;
	console.log('this is currentStateRow: ' + currentStateRow);
	console.log('this is currentStateData: ' + currentStateData);
	console.log('this is x: ' + x);
});


//callback function that iterates through array of of previously made tables
$('#preMade').click(function (evt) {
	evt.preventDefault();
	$('#brush').trigger('click');
	
	if (ranAlready === true) {
		reset(ranAlready);
	} else {
		if (next <= preDrawn.length) {
			$('#pixelCanvas').append(preDrawn[next]);
			next++;
			console.log('this is next val: ' + next);
			ranAlready = true;
		} else {
			next = 0;
		}
	}
});


